import React, { useState, useEffect } from "react";
import { performAnalysis } from "./Analysis";

const AnalysisDisplay = () => {
  const [analysisResults, setAnalysisResults] = useState(null);
  const [error, setError] = useState(null);

  useEffect(() => {
    const fetchData = async () => {
      try {
        const results = await performAnalysis();
        setAnalysisResults(results);
      } catch (err) {
        setError(err);
      }
    };

    fetchData();
  }, []);

  if (error) {
    return <div>Error fetching analysis data: {error.message}</div>;
  }

  if (!analysisResults) {
    return <div>Loading...</div>;
  }

  const {
    totalROI,
    numberOfTrades,
    sharpeRatio,
    netPL,
    cashBalance,
    winningTrades,
    losingTrades,
    winRate,
    averageWin,
    averageLoss,
    riskRewardRatio,
    maximumDrawdown,
  } = analysisResults;

  return (
    <div className="analysis-container">
      <div className="analysis-card">
        <h3>Total ROI</h3>
        <p>{totalROI.toFixed(2)}%</p>
      </div>
      <div className="analysis-card">
        <h3>Number of Trades</h3>
        <p>{numberOfTrades}</p>
      </div>
      <div className="analysis-card">
        <h3>Sharpe Ratio</h3>
        <p>{sharpeRatio.toFixed(2)}</p>
      </div>
      <div className="analysis-card">
        <h3>Net P/L</h3>
        <p>${netPL.toFixed(2)}</p>
      </div>
      <div className="analysis-card">
        <h3>Cash Balance</h3>
        <p>${cashBalance.toFixed(2)}</p>
      </div>
      <div className="analysis-card">
        <h3>Winning Trades</h3>
        <p>{winningTrades}</p>
      </div>
      <div className="analysis-card">
        <h3>Losing Trades</h3>
        <p>{losingTrades}</p>
      </div>
      <div className="analysis-card">
        <h3>Win Rate</h3>
        <p>{winRate.toFixed(2)}%</p>
      </div>
      <div className="analysis-card">
        <h3>Average Win</h3>
        <p>${averageWin.toFixed(2)}</p>
      </div>
      <div className="analysis-card">
        <h3>Average Loss</h3>
        <p>${averageLoss.toFixed(2)}</p>
      </div>
      <div className="analysis-card">
        <h3>Risk-Reward Ratio</h3>
        <p>{riskRewardRatio.toFixed(2)}</p>
      </div>
      <div className="analysis-card">
        <h3>Maximum Drawdown</h3>
        <p>{maximumDrawdown.toFixed(2)}%</p>
      </div>
    </div>
  );
};

export default AnalysisDisplay;
